import express from "express";
import routes from "../routes";

import { home, search } from "../controllers/videoController";
import {
  getLogin,
  postLogin,
  postJoin,
  getJoin,
  logout,
  githubLogin,
  githubLoginCallback,
  facebookLogin,
  facebookLoginCallback,
} from "../controllers/userController";

import { onlyPublic } from "../localsMiddleware";

